import React, { Component } from "react";
import { connect } from "react-redux";

class EditBabyName extends Component {
  render() {
    return (
      <>
        <div className="editBabyName-heading"></div>
      </>
    );
  }
}

function mapStateToProps(state) {
  return {
    babyName: state.babyName,
  };
}
export default connect(mapStateToProps)(EditBabyName);
